import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on cart element to open cart modal
    await page.waitForSelector('.cart');
    await page.click('.cart');

    // Wait for cart modal to appear
    await page.waitForSelector('#cartModal', { state: 'visible' });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_opened.png'));

    // Check if cart is empty
    const emptyCart = await page.$('.empty-cart');
    if (emptyCart) {
      throw new Error('Cart is empty - cannot remove items');
    }

    // Get cart items count before removal
    const initialCount = await page.textContent('.cart-count');

    // Click remove button for the first item in cart
    await page.waitForSelector('.remove-item');
    await page.click('.remove-item:first-child');

    // Wait for cart to update
    await page.waitForFunction((initial) => {
      const currentCount = document.querySelector('.cart-count')?.textContent;
      return currentCount !== initial;
    }, initialCount);

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_item_removed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_item_removed.png'));

    // Verify removal was successful
    const finalCount = await page.textContent('.cart-count');
    const cartItems = await page.$$('.cart-item');

    return {
      success: true,
      action: "Removed item from cart successfully",
      extractedData: {
        initialItemCount: parseInt(initialCount),
        finalItemCount: parseInt(finalCount),
        itemsRemoved: parseInt(initialCount) - parseInt(finalCount)
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to remove item from cart",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
